import React from 'react';
import { Card,CardBody } from 'reactstrap';
import moment from 'moment';


import './booking-card.css';

const BookingCard = ({booking}) => {
    console.log("details: ",booking.userEmail)

    const {userEmail,tourName,fullName,guestSize,phone,bookAt} = booking;

    return <div className='tour__card'>
    <Card>
        <div className="tour__img">
            {/* <img src={photo} alt='tour-img' /> */}
        </div>

        <CardBody>
            <input type="text" value={userEmail} disabled />
            <input type="text" value={fullName} disabled />
            <input type="text" value={tourName} disabled />
            <input type="number" value={guestSize} disabled />
            <input type="number" value={phone} disabled />
            <input type="date" value={moment(bookAt).format('YYYY-MM-DD')} disabled />
    

        </CardBody>

    </Card>
    </div>
};

export default BookingCard;
